import { NavLink } from 'react-router-dom';
import { useEffect, useState } from 'react';
import { getNav } from '../utils/navService';
import styled from 'styled-components';

const StyledSection = styled.section`
display: flex;
background: ${({ theme }) => theme.colors.green};
flex-direction: row;
`;

const StyledUl = styled.ul`
display: flex;
flex-direction: row;
justify-content: space-evenly;
background: ${({ theme }) => theme.colors.lilac};
list-style: none;
  a{
    text-decoration: none;
    list-style: none;
    color: ${({ theme }) => theme.colors.romanSilver};
    font-size: 4.2rem;
}
`;

const Navigation = () => {
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(null);
  const [error, setError] = useState(null);
  console.log(data);
  /* henter nav-data fra sanity */
  useEffect(() => {
    const fetchDataAsync = async () => {
      setLoading(true);
      try {
        const navigation = await getNav('header');
        setData(navigation);
      } catch (error) {
        setError(error);
      } finally {
        setLoading(false);
      }
    };
    fetchDataAsync();
  }, []);

  return (
    <StyledSection>
      {error? <p>Ooops, noe har skjedd</p> : null}
      {loading? <p>Menyene laster inn..</p> : null}
      <StyledUl>
        {data?.link?.length > 0 &&
        data?.link?.map((nav) => (
          <li key={nav._key}> <NavLink exact to={`/${nav.href}`} activeClassName="active">
          {nav.name}</NavLink>
          </li>
        ))
        }
      </StyledUl>
    </StyledSection>

  );
};
export default Navigation;
